class SegTree():
    """区間加算，圧縮区間内の頂点及び距離"""
    def __init__(self, s):
        self.s = s
        self.n = len(s)
        self.seg = [None] * (2*self.n-1)
        for i in range(1,self.n):
            self.seg[i] = self.seg[i-1]
        for i in range(self.n-2,0,-1):
            self.seg[i] = self.seg[i-1]
            self.seg[i+1] = self.seg[i]

    def update(self, i, x):
        i += self.n
        self.seg[i] = x
        while i:
            i = i-1
            self.seg[i] = self.seg[i+1]

    def query(self, i, j):
        i += self.n
        j += self.n
        return self.seg[i] == self.seg[j]

    def invert(self):
        """逆合操作"""
        self.n = 2*self.n-1
        self.seg = [None] * (2*self.n-1)
        for i in range(1,self.n):
            self.seg[i] = self.seg[i-1]

    def add_edge(self, i, j):
        """斜めの点数を求める"""
        self.update(i, i)
        self.update(j, j)

    def get_components(self):
        """区間の区間クエリを返す"""
        ret = []
        for i in range(self.n):
            ret.append([])
        for i in range(self.n):
